['In order to understand  this, we first write the phenomenological scaling form for $O$,  analogous to Eq. \eqref{eq:scalingass} in  the Letter,
\begin{eqnarray}
O (t, L_{\parallel} ; S_\Delta) = L_{\parallel}^{-\beta/[\nu(1+\Delta)]} \tilde f_O (t/L_{\parallel}^{z/(1+\Delta)} ; S_\Delta).\quad
\label{eq:Oscalingass}
\end{eqnarray}', '\section*{Dynamical Behaviour of $O$ in Lattice Gases}', 'We already remarked that, in the LG, this scaling form is not compatible with the prediction $O \sim t^{1/8}  L_{\parallel}^{-1/2}$ of the Gaussian theory.  However, following Ref. \cite{AS2002}, it can be argued that, at short times, the only dependence of $O$ on the system size $L_{\parallel}$ is of the form $O \sim L_\parallel^{-1/2}$ which is very well confirmed by numerical simulations. Accordingly,  the generic behaviour of $O$ can be assumed to be
\begin{eqnarray}
O \sim t^{\alpha} L_\parallel^{-1/2}, \label{eq:O}
\end{eqnarray}', 'The dynamical behaviour of the anisotropic order parameter  $m$ [see Eq.~\eqref{eq:def-m} in the Letter] following a quench to the critical point is well described by
the Gaussian theory for all the three lattice gas models studied, $i.e.,$ driven lattice gas with either constant (IDLG) or random (RDLG) infinite drive and equilibrium lattice gas (LG). In other words, in the short-time regime, $m \sim t^{1/2}$ [see Eq. \eqref{eq:mt}] and the Binder cumulant $g$ of the lowest transverse mode [defined in Eq. \eqref{eq:binder}] is zero in this regime. The alternative order parameter $O,$ however, distinguishes between the driven (IDLG, RDLG) and the equilibrium (LG) lattice gases.', 'where $\alpha$ is a phenomenological exponent to be determined. This, along with Eq. \eqref{eq:Oscalingass}, implies $\tilde f_O(x) \sim x^{\alpha}.$ Comparing the finite-size behaviour in Eq.~\eqref{eq:O} with Eq.~\eqref{eq:Oscalingass} one actually infers,
\begin{eqnarray}
\alpha &=& \frac{1+ \Delta -2 \beta/\nu}{2 \, (4- \eta)}. \label{eq:alpha}
\end{eqnarray}
This equation, together with the hyperscaling relation $\Delta - 2 \beta/\nu= - \eta$ in two spatial dimensions, shows that the prediction $\alpha = 1/8$ of the Gaussian theory [see Eq. \eqref{eq:Ot}] can be obtained only when $\eta=0,$ which is the case for the IDLG (exactly) and the RDLG (approximately) but not for the LG.']
